import React, { useState, useEffect } from "react";
import { MapContainer, TileLayer, Marker, Popup } from "react-leaflet";
import "leaflet/dist/leaflet.css";

export default function AdminDashboard({ isAdmin }) {
  const [pois, setPois] = useState([]);
  const [newPOI, setNewPOI] = useState({
    id: "",
    name: "",
    lat: "",
    lng: "",
    visitors: "Moderate",
    tags: "",
    description: "",
    image: "",
  });

  useEffect(() => {
    if (!isAdmin) return;
    fetch("http://localhost:5000/api/pois")
      .then((res) => res.json())
      .then((data) => setPois(data));
  }, [isAdmin]);

  const handleAddPOI = () => {
    fetch("http://localhost:5000/api/pois", {
      method: "POST",
      headers: { "Content-Type": "application/json" },
      body: JSON.stringify(newPOI),
    })
      .then((res) => res.json())
      .then(() => {
        setPois([...pois, newPOI]);
        setNewPOI({ id: "", name: "", lat: "", lng: "", visitors: "Moderate", tags: "", description: "", image: "" });
      });
  };

  if (!isAdmin) return <h2>Access Denied</h2>;

  return (
    <div style={{ padding: 20 }}>
      <h1>Admin Dashboard</h1>

      <h2>Add New POI</h2>
      <input placeholder="ID" value={newPOI.id} onChange={e => setNewPOI({ ...newPOI, id: e.target.value })} />
      <input placeholder="Name" value={newPOI.name} onChange={e => setNewPOI({ ...newPOI, name: e.target.value })} />
      <input placeholder="Latitude" value={newPOI.lat} onChange={e => setNewPOI({ ...newPOI, lat: e.target.value })} />
      <input placeholder="Longitude" value={newPOI.lng} onChange={e => setNewPOI({ ...newPOI, lng: e.target.value })} />
      <input placeholder="Visitors" value={newPOI.visitors} onChange={e => setNewPOI({ ...newPOI, visitors: e.target.value })} />
      <input placeholder="Tags" value={newPOI.tags} onChange={e => setNewPOI({ ...newPOI, tags: e.target.value })} />
      <input placeholder="Description" value={newPOI.description} onChange={e => setNewPOI({ ...newPOI, description: e.target.value })} />
      <input placeholder="Image URL" value={newPOI.image} onChange={e => setNewPOI({ ...newPOI, image: e.target.value })} />
      <button onClick={handleAddPOI}>Add POI</button>

      <h2>POIs Map</h2>
      <MapContainer center={[14.1467, 121.4708]} zoom={13} style={{ height: "500px", width: "100%" }}>
        <TileLayer url="https://{s}.tile.openstreetmap.org/{z}/{x}/{y}.png" attribution="&copy; OSM contributors" />
        {pois.map((p) => (
          <Marker key={p.id} position={[parseFloat(p.lat), parseFloat(p.lng)]}>
            <Popup>
              <strong>{p.name}</strong><br />
              {p.description}<br />
              {p.image && <img src={p.image} alt={p.name} style={{ width: "150px" }} />}
            </Popup>
          </Marker>
        ))}
      </MapContainer>
    </div>
  );
}
